// src/components/CloudEdgeLogo.jsx
import React from 'react';

const CloudEdgeLogo = ({ className }) => (
  <svg className={className} viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg">
    <defs>
      <linearGradient id="cloudGradient" x1="0%" y1="0%" x2="100%" y2="100%">
        <stop offset="0%" stopColor="#4F46E5" />
        <stop offset="100%" stopColor="#7C3AED" />
      </linearGradient>
    </defs>
    {/* Base Circle */}
    <circle cx="20" cy="20" r="18" fill="url(#cloudGradient)" fillOpacity="0.1" stroke="url(#cloudGradient)" strokeWidth="2" />
    
    {/* Cloud Path */}
    <path 
      d="M26 24H14C11.7909 24 10 22.2091 10 20C10 17.7909 11.7909 16 14 16C14.3721 16 14.7323 16.0377 15.0746 16.1082C15.3766 14.2876 17.0399 13 19 13C21.2091 13 23 14.7909 23 17C23 17.1826 22.9859 17.362 22.9587 17.5375C24.7355 17.8691 26 19.4592 26 21.3333C26 22.8061 24.8807 24 23.5 24"
      stroke="url(#cloudGradient)"
      strokeWidth="2"
      strokeLinecap="round"
    />
    
    {/* Network Lines */}
    <path 
      d="M18 20L20 17M20 17L22 20M20 17V23" 
      stroke="url(#cloudGradient)"
      strokeWidth="2"
      strokeLinecap="round"
    />
  </svg>
);

export default CloudEdgeLogo;
